import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import './components/Navbars.js';
import Navbars from './components/Navbars.js';

import Footers from './components/Footers';
import Slider from './components/Slider';



function App() {
  return (
    <container>

      <Navbars />

      <Slider />


      <Footers />

    </container>


  )
}

export default App;
